question:
An equilateral triangle has two vertices at $(0,5)$ and $(8,5)$. If the third vertex is in the first quadrant, what is the y-coordinate? Express your answer in simplest radical form. [asy]
draw((-1,0)--(11,0),Arrows);
draw((0,-1)--(0,12),Arrows);
for(int i=0;i<11;++i)
{draw((i,-0.1)--(i,0.1));}
for(int j=0;j<11;++j)
{draw((-0.1,j)--(0.1,j));}
dot((0,5));
dot((8,5));
label("(0,5)",(0,5),W);
draw((0,5)--(8,5));
label("(8,5)",(8,5),E);
size(6cm);
[/asy]

Answer choices:
(A) 5+4\sqrt{2}
(B) 5+4\sqrt{3}
(C) None of the above

Rules:
1. Answer with reasoning steps separated by new lines.
2. Give the final answer as the final step in the form "The best answer is (X)". You must give an answer.
3. Every reasoning step must be consistent with the previous step. Even if the previous step is wrong.

An 8-foot by 10-foot floor is tiled with square tiles of size 1 foot by 1 foot. Each tile has a pattern consisting of four white quarter circles of radius 1/2 foot centered at each corner of the tile. The remaining portion of the tile is shaded. How many square feet of the floor are shaded?
[asy]
fill((5,5)--(5,-5)--(-5,-5)--(-5,5)--cycle,gray(0.7));
fill(Circle((-5,5),5),white);
fill(Circle((5,5),5),white);
fill(Circle((-5,-5),5),white);
fill(Circle((5,-5),5),white);
draw((-5,5)--(-5,-5)--(5,-5)--(5,5)--cycle);
[/asy]

Answer choices:
(A) 80 - 20\pi
(B) 80\left(1 - \frac{\pi}{4}\right)
(C) None of the above

Rules:
1. Answer with reasoning steps separated by new lines.
2. Give the final answer as the final step in the form "The best answer is (X)". You must give an answer.
3. Every reasoning step must be consistent with the previous step. Even if the previous step is wrong.

In right $\Delta ABC$, $\angle CAB$ is a right angle. Point $M$ is the midpoint of $\overline{BC}$. What is the number of centimeters in the length of median $\overline{AM}$? Express your answer as a decimal to the nearest tenth. [asy] pair A,B,C,M;
A = (0,0); B = (4,0); C = (0,3); M = (B+C)/2;
draw(M--A--B--C--A);
label("$A$",A,W); label("$B$",B,E);
label("$C$",C,W); label("$M$",M,NE);
label("3 cm",A--C,W); label("4 cm",A--B,S);
[/asy]

Answer choices:
(A) 2.5
(B) 5
(C) None of the above


